import React, { Component } from 'react';
import me from '../images/Me.JPG';

class About extends Component {	

	render() {
		return(
			<div className= "about AFlex">
				<h1>Hello!</h1>
				<img className="myPic" alt="Mars Howard" src={me}></img>
			</div>
		)
	}
}

export default About
